Termination_acc <- function(value)
{
	if (!isnull(.self$.cobj)) {
		if (missing(value)) {
			so_TargetToolMessages_get_Termination(.self$.cobj)
		} else {
			if (!is(value, "character")) {
				stop("object must be of type 'character'")
			}
			so_TargetToolMessages_set_Termination(.self$.cobj, value)
		}
	}
}

