OutputFilePath_acc <- function(value)
{
	if (!isnull(.self$.cobj)) {
		if (missing(value)) {
			child = so_TargetToolMessages_get_OutputFilePath(.self$.cobj)
			if (!isnull(child)) {
				so_ExternalFile_ref(child)
				so_ExternalFile$new(cobj=child)
			}
		} else {
			if (!is(value, "so_ExternalFile")) {
				stop("object must be of type 'so_ExternalFile'")
			}
			so_TargetToolMessages_set_OutputFilePath(.self$.cobj, value$.cobj)
			so_ExternalFile_ref(value$.cobj)
		}
	}
}

