		.cobj = "externalptr"
	),
	methods=list(
		copy = function() {
			copy = so_TargetToolMessages_copy(.self$.cobj)
			so_TargetToolMessages$new(cobj=copy)
		},
		initialize = function(cobj) {
			if (missing(cobj)) {
				.cobj <<- so_TargetToolMessages_new()
			} else {
				.cobj <<- cobj
			}
		},
		finalize = function() {
			so_TargetToolMessages_unref(.self$.cobj)
		}
	)
)
